    render() {
        const handleChange = e => {
            setSearch(e.target.value)
        }
        //axios.get('http://localhost:8080/assets');

        return (
            <div className="text-white"> Welcome to our portfolio application! 
            <div>Here you can create your own portfolio to manage and track.</div>

            <Row>
                <p></p>
                <Col xs={5}>
                <Card className="border border-dark bg-dark text-white">
                <Card.Header>
                    Portfolio
                </Card.Header>
                <Card.Body>
                    <Form>
                    <div className='coin-search'>
                        <h3 className='coin-text'>Top 100 Cryptocurrency Prices by Market Cap</h3>
                        <form>
                            <input type='text' placeholder='Search'
                                   className='coin-input' onChange={handleChange}/>
                        </form>
                    </div>
                        

                    </Form>
                </Card.Body>
                </Card>
                </Col>
            </Row>
            </div> 
        );
    }
}

export default Portfolio;
